import React from 'react';
import './Cards.css';
import Card from './Card.jsx';

export default function Cards(props) {
  return (
    <div className='cards'>
      {props.cities.map((c,index) => <Card
          key={index}
          max={c.max}
          min={c.min}
          name={c.name}
          img={c.img}
          id={c.id}
          onClose={props.onClose}
        /> )}
    </div>
  );
}
